import { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor() {
    super();

    this.state = {
      monsters: [
        {
          name: 'Linda',
          id: '234lkhj5234lk'
        },
        {
          name: 'Frank',
          id: '234lkh4lk'
        },
        {
          name: 'Jacky',
          id: '2dsgs3lkhj5234lk'
        },
        {
          name: 'RACH',
          id: '234lkhj11ji4lk'
        },
      ]
    };
  }

  render() {
    return (
      <div className="App">
      {this.state.monsters.map((monster) => {
        return <div key={monster.id}><h1>{monster.name}</h1></div>
      })}

      </div>
    );
  }
}

export default App;
